column8:
多くのビタミンB群を特別に調合した鳥類用水溶性粉末栄養補助食品です。<Br>
ビーコンプレックスに含まれる多くのビタミンB群は、季節の変わり目や環境の変化時、また繁殖期や療養中等、体調が不安定になり安い時期やストレスのかかりやすい時期に鳥類の健康を保つために必要不可欠です。<Br><Br>
ネクトンB-コンプレックスは、ビタミンBの複合体のあらゆるものを化合して調整してあります。<Br>
 ネクトンQと同じく抗生物質やスルフォンアミドで治療中の鳥達はビタミンが不足してきます。<Br>病気の治療中と予後に効果を発揮するサプリメントです。<Br>
<Br>【1000g中の含有保証成分及び原材料】<Br>
・ビタミンB1/チリミン（1500mg）<Br>
・ビタミンB2/リボフラビン（3400mg）<Br>
・ビタミンB3/ニコチン酸アミド（3000mg）<Br>
・ビタミンB5/パントテン酸（1000mg）<Br>
・ビタミンB6/ピリドキシン（3400mg）<Br>
・ビタミンB9/葉酸（50000mg）<Br><Br>
原産国：ドイツ<Br><Br>
【与え方】<Br>
・体調が不安定な時期、またストレスのかかる時期において ネクトンSと同時に飲水等に混ぜて与えて下さい。<Br>
・一般的な鳩のサイズまでの鳥類には、1日1g。<Br>
より大きいサイズの鳥類には、1日1～2g程度を与えて下さい。<!-- 帯バナー(RMSは共通説明文大に入ってる)-->

