文鳥のヒナを育てるのに必要なものを揃えました。<BR>「オハチ」のセットです。<P>

【セット内容】<P>
・オハチ<BR>
・あわ玉　<Br>
・ラウディブッシュ　オリジナルフォーミュラー（100g）　※パウダーフードです<Br>
・育て親（文鳥用）<BR>
・アニマルバード　※オハチの底に敷いてお使い下さい<P>

※エサを与える際は、あわ玉にお湯を注いで20分～30分程置いた後、冷たくなった水を捨て、この状態でフォーミュラーを入れます。<BR>
あわ玉とパウダーの量は、2対1ぐらいの割合です。そしてお湯を注ぎます。(スプーンでヒナに流し込めるぐらいの量です)　<BR>
よくスプーンで混ぜた後、人肌よりあたたかい状態で与えます。
<Br>冷めた場合は湯煎で温めて下さい。<br><Br>

●ヒナはとてもデリケートです！特に、寒い時期はヒーターが必要です。<BR>　
飼育環境や生体の状態によっては季節に関係なく保温が必要な場合もあります。<BR>　
温度計・湿度計があると便利です。<P>

<FONT SIZE="2">
≪オススメ商品≫<Br>
【温度計・湿度計】<BR>

・
レプロ　サーモメーター （温度計）<br>

・
レプロ　ハイグロメーター　（湿度計）<br>
<BR>
【パネルヒーター】<BR>
・
マルチ　パネルヒーター８Ｗ　（設定温度可変式）<br>
・
マルチ　パネルヒーター１４Ｗ　（設定温度可変式）<P>

※飼育環境や生体の状態によって、必要なヒーターのワット数は異なります。<P>

※パネルヒーターは温度調節可能なものを おすすめします。<P><!-- 帯バナー(RMSは共通説明文大に入ってる)-->

